INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('random_forest_classifier', (select id from ml_task_type where name='classification'),'Random Forest Classifier is a specialized type of tree-based model implementing meta estimator that fits a number of decision tree classifiers on various sub-samples of the dataset and uses averaging to improve the predictive accuracy and control over-fitting.', 'Random Forest Classifier', (select id from model_structure_type where name='base'), '{It performs well on imbalanced datasets,It is robust to outliers,There is more generalization and less overfitting,It is useful to extract feature importance}', '{It requires that features need to have some predictive power}', true, (select id from model_ensemble_type where name='forest'),(select id from model_family_type where name='tree'), false, (select id from dependency_group_type where name='base'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='random_forest_classifier'),(select id from model_group_type where name='explainable'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='random_forest_classifier'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('bootstrap', 'Bootstrap', 'Whether bootstrap samples are used when building trees. If False, the whole dataset is used to build each tree.', false, false, 1, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('ccp_alpha', 'Cost-Complexity Pruning alpha', 'Complexity parameter used for Minimal Cost-Complexity Pruning. The subtree with the largest cost complexity that is smaller than ccp_alpha will be chosen. By default, no pruning is performed.', false, false, 2, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Sets the weights for all classes. If None, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)). The “balanced_subsample” mode is the same as “balanced” except that weights are computed based on the bootstrap sample for every tree grown.', false, false, 3, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('criterion', 'Criterion', 'The function to measure the quality of a split.', false, false, 4, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth of the tree. If None, then nodes are expanded until all leaves are pure or until all leaves contain less than min_samples_split samples.', true, false, 5, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_features', 'Maximum features', 'The number of features to draw from X to train each base estimator.', true, false, 6, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_leaf_nodes', 'Maximum number of nodes', 'Grow a tree with max_leaf_nodes in best-first fashion. Best nodes are defined as relative reduction in impurity. If None then unlimited number of leaf nodes.', false, false, 7, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_samples', 'Maximum samples', 'The number of samples to draw from X to train each base estimator.', false, false, 8, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_impurity_decrease', 'Minimum impurity decrease', 'A node will be split if this split induces a decrease of the impurity greater than or equal to this value.', false, false, 9, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_leaf', 'Minimum samples per leaf', 'The minimum number of samples required to be at a leaf node.', false, false, 10, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_split', 'Minimum sample split', 'The minimum number of samples required to split an internal node.', false, false, 11, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_weight_fraction_leaf', 'Minimum weighted sum per leaf', 'The minimum weighted fraction of the sum total of weights (of all the input samples) required to be at a leaf node. Samples have equal weight when sample_weight is not provided.', false, false, 12, (select id from Model where name='random_forest_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_estimators', 'Number of estimators', 'The number of base estimators in the ensemble.', true, false, 13, (select id from Model where name='random_forest_classifier'));
