INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('perceptron_classifier', (select id from ml_task_type where name='classification'),'The Perceptron Classifier is a linear classification model based on a simple artificial neural unit. It iteratively adjusts weights in the input features to find a hyperplane that separates two classes. It is well-suited for high-dimensional data and is one of the simplest types of classifiers.', 'Perceptron Classifier', (select id from model_structure_type where name='base'), '{Simple and easy to understand,Fast to train,Works well with high-dimensional data,Low computational requirements}', '{Sensitive to feature scaling,Not suitable for non-linearly separable data,May not converge if data is not linearly separable,Lacks probabilistic interpretation}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from dependency_group_type where name='base'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('alpha', 'Alpha', 'Constant that multiplies the penalty terms.', true, false, 1, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Weights associated with classes in the form {class_label: weight}. If not given, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)).', false, false, 2, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('early_stopping', 'Early stopping', 'Whether to use early stopping to terminate training when validation score is not improving.', false, false, 3, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('eta0', 'Eta0', 'The initial learning rate for the ''constant'', ''invscaling'' or ''adaptive'' schedules.', false, false, 4, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 5, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', true, false, 6, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_iter_no_change', 'Maximum number of iterations with no change', 'Maximum number of epochs to not meet tol improvement. Only effective when solver=''sgd'' or ''adam''.', false, false, 7, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('penalty', 'Penalty', 'The penalty (aka regularization term) to be used.', true, false, 8, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('shuffle', 'Shuffle', 'Whether to shuffle samples in each iteration.', false, false, 9, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', true, false, 10, (select id from Model where name='perceptron_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('validation_fraction', 'Validation fraction', 'The proportion of training data to set aside as validation set for early stopping.', false, false, 11, (select id from Model where name='perceptron_classifier'));
