INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('hist_gradient_boosting_classifier', (select id from ml_task_type where name='classification'),'Histogram-based Gradient Boosting Classifier is much faster than the Gradient Boosting Classifier for big datasets (n_samples >= 10 000). It has native support for missing values (NaNs). During training, the tree grower learns at each split point whether samples with missing values should go to the left or right child, based on the potential gain. When predicting, samples with missing values are assigned to the left or right child consequently.', 'Histogram-based Gradient Boosting Classifier', (select id from model_structure_type where name='base'), '{It requires no pre-processing of data like the normalization and the scaling of data}', '{It is sensitive to outliers,It has the problem of overfitting,It is computationally expensive}', false, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='tree'), false, (select id from dependency_group_type where name='base'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l2_regularization', 'L2 regularization', 'The L2 regularization parameter. Use 0 for no regularization.', true, false, 1, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Step size shrinkage used in update to prevents overfitting. After each boosting step, we can directly get the weights of new features, and eta shrinks the feature weights to make the boosting process more conservative.', false, false, 2, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('loss', 'Loss', 'Loss function to be optimized.', true, false, 3, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_bins', 'Maximum bins', 'The maximum number of bins to use for non-missing values.', false, false, 4, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth of the tree. If None, then nodes are expanded until all leaves are pure or until all leaves contain less than min_samples_split samples.', true, false, 5, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', false, false, 6, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_leaf_nodes', 'Maximum number of nodes', 'Grow a tree with max_leaf_nodes in best-first fashion. Best nodes are defined as relative reduction in impurity. If None then unlimited number of leaf nodes.', true, false, 7, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_leaf', 'Minimum samples per leaf', 'The minimum number of samples required to be at a leaf node.', false, false, 8, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_iter_no_change', 'Maximum number of iterations with no change', 'Maximum number of epochs to not meet tol improvement. Only effective when solver=''sgd'' or ''adam''.', false, false, 9, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', true, false, 10, (select id from Model where name='hist_gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('validation_fraction', 'Validation fraction', 'The proportion of training data to set aside as validation set for early stopping.', false, false, 11, (select id from Model where name='hist_gradient_boosting_classifier'));
