INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('gaussian_naivebayes_classifier', (select id from ml_task_type where name='classification'),'Gaussian Naive Bayes Classifier implements the Gaussian Naive Bayes training and classification algorithm for classification. The likelihood of the features is assumed to be Gaussian. It can perform online updates to model parameters via partial_fit.', 'Gaussian Naive Bayes Classifier', (select id from model_structure_type where name='base'), '{It is computational efficient,It performs well on small amounts of data,It can handle irrelevant features nicely}', '{It has a strong assumption based on the shape of data,It is not stable}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='base'));
