INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('ccp_alpha', 'Cost-Complexity Pruning alpha', 'Complexity parameter used for Minimal Cost-Complexity Pruning. The subtree with the largest cost complexity that is smaller than ccp_alpha will be chosen. By default, no pruning is performed.', true, false, 1, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Sets the weights for all classes. If None, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)).', false, false, 2, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('criterion', 'Criterion', 'The function to measure the quality of a split.', false, false, 3, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth of the tree. If None, then nodes are expanded until all leaves are pure or until all leaves contain less than min_samples_split samples.', true, false, 4, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_features', 'Maximum features', 'The number of features to draw from X to train each base estimator.', true, false, 5, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_leaf_nodes', 'Maximum number of nodes', 'Grow a tree with max_leaf_nodes in best-first fashion. Best nodes are defined as relative reduction in impurity.', true, false, 6, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_impurity_decrease', 'Minimum impurity decrease', 'A node will be split if this split induces a decrease of the impurity greater than or equal to this value.', false, false, 7, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_leaf', 'Minimum samples per leaf', 'The minimum number of samples required to be at a leaf node.', false, false, 8, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_split', 'Minimum sample split', 'The minimum number of samples required to split an internal node expressed as a fraction of all training samples.', true, false, 9, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_weight_fraction_leaf', 'Minimum weighted sum per leaf', 'The minimum weighted fraction of the sum total of weights (of all the input samples) required to be at a leaf node. Samples have equal weight when sample_weight is not provided.', false, false, 10, (select id from Model where name='decision_tree_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('splitter', 'Splitter', 'The strategy used to choose the split at each node.', false, false, 11, (select id from Model where name='decision_tree_classifier'));
