INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('prior_dummy_classifier', (select id from ml_task_type where name='classification'),'The prior dummy classifier always returns the most frequent class label from the training data. It''s prediction probabilities match the class distribution of the training data.', 'Prior Dummy Classifier', (select id from model_structure_type where name='base'), '{Easily explainable.,Fast to train.,Provides a reference with which to compare other models.}', '{Ignores all feature information.,Poor performance.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='base'));
