INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('extra_trees_classifier', (select id from ml_task_type where name='classification'),'The Extremely Randomized Trees (Extra-Trees) Classifier is an ensemble model that builds multiple randomized decision trees and averages their predictions. This approach aims to improve accuracy and reduce overfitting.', 'Extremely Randomized Tree Ensemble Classifier', (select id from model_structure_type where name='base'), '{Robust to overfitting,Highly parallelizable,Provides feature importance,Quick to train,Versatile}', '{Low interpretability,High memory usage,Predictive variability,Less accurate than some boosting methods,Requires hyperparameter tuning}', true, (select id from model_ensemble_type where name='forest'),(select id from model_family_type where name='tree'), false, (select id from dependency_group_type where name='base'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('bootstrap', 'Bootstrap', 'Whether bootstrap samples are used when building trees. If False, the whole dataset is used to build each tree.', false, false, 1, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('ccp_alpha', 'Cost-Complexity Pruning alpha', 'Complexity parameter used for Minimal Cost-Complexity Pruning. The subtree with the largest cost complexity that is smaller than ccp_alpha will be chosen. By default, no pruning is performed.', false, false, 2, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Sets the weights for all classes. If None, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)). The “balanced_subsample” mode is the same as “balanced” except that weights are computed based on the bootstrap sample for every tree grown.', false, false, 3, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('criterion', 'Criterion', 'The function to measure the quality of a split.', false, false, 4, (select id from Model where name='extra_trees_classifier'));
