INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_features', 'Maximum features', 'The number of features to draw from X to train each base estimator.', false, false, 6, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_leaf_nodes', 'Maximum number of nodes', 'Grow a tree with max_leaf_nodes in best-first fashion. Best nodes are defined as relative reduction in impurity.', false, false, 7, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_samples', 'Maximum samples', 'The number of samples to draw from X to train each base estimator.', false, false, 8, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_impurity_decrease', 'Minimum impurity decrease', 'A node will be split if this split induces a decrease of the impurity greater than or equal to this value.', false, false, 9, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_leaf', 'Minimum samples per leaf', 'The minimum number of samples required to be at a leaf node.', false, false, 10, (select id from Model where name='extra_trees_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_split', 'Minimum sample split', 'The minimum number of samples required to split an internal node.', false, false, 11, (select id from Model where name='extra_trees_classifier'));
