INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('gaussian_process_classifier', (select id from ml_task_type where name='classification'),'Gaussian Process Classifier is a nonparametric, bayesian probabilistic classification using a Gaussian process as a prior over random functions and Laplace approximation as the non-Gaussian posterior.', 'Gaussian Process Classifier', (select id from model_structure_type where name='base'), '{It performs well on small datasets,It has the ability to provide uncertainty measurements on the predictions,It has the flexibility in using different kernels}', '{It loses efficiency in high dimensional spaces}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='base'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='gaussian_process_classifier'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter_predict', 'Maximum number of iterations', 'The maximum number of iterations in Newton''s method for approximating the posterior during predict. Smaller values will reduce computation time at the cost of worse results.', true, false, 1, (select id from Model where name='gaussian_process_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_restarts_optimizer', 'Number of restarts', 'The number of restarts of the optimizer for finding the kernel''s parameters which maximize the log-marginal likelihood. The first run of the optimizer is performed from the kernel''s initial parameters, the remaining ones (if any) from thetas sampled log-uniform randomly from the space of allowed theta-values. If greater than 0, all bounds must be finite. Note that n_restarts_optimizer == 0 implies that one run is performed.', true, false, 2, (select id from Model where name='gaussian_process_classifier'));
INSERT INTO rel_model__model_type(model_id, model_type_id) VALUES ((select id from model where name='gaussian_process_classifier'), (select id from model_type where name='Bayesian Model'));
INSERT INTO rel_model__model_type(model_id, model_type_id) VALUES ((select id from model where name='gaussian_process_classifier'), (select id from model_type where name='Kernel Model'));
INSERT INTO parameter_type_definition(parameter_id, parameter_type_id, parameter_distribution_type_id, ordering) VALUES ((select id from parameter where name='max_iter_predict' and model_id=(select id from model where name='gaussian_process_classifier')), (select id from parameter_type where name='integer'), (select id from parameter_distribution_type where name='uniform'), 0);
INSERT INTO parameter_type_definition(parameter_id, parameter_type_id, parameter_distribution_type_id, ordering) VALUES ((select id from parameter where name='n_restarts_optimizer' and model_id=(select id from model where name='gaussian_process_classifier')), (select id from parameter_type where name='integer'), (select id from parameter_distribution_type where name='uniform'), 0);
INSERT INTO integer_parameter(id, default_value) VALUES ((select id from parameter_type_definition where parameter_id=(select id from parameter where name='max_iter_predict' and model_id=(select id from model where name='gaussian_process_classifier') and parameter_type_id=(select id from parameter_type where name='integer'))), 100);
