INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('gradient_boosting_classifier', (select id from ml_task_type where name='classification'),'Gradient Boosting Classifier builds an additive model in a forward stage-wise fashion; it allows for the optimization of arbitrary differentiable loss functions. In each stage, n_classes_ classifier trees are fitted on the negative gradient of the binomial or multinomial deviance loss function.', 'Gradient Boosting Classifier', (select id from model_structure_type where name='base'), '{It requires no pre-processing of data like the normalization and the scaling of data}', '{It is sensitive to outliers,It has the problem of overfitting,It is computationally expensive}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='tree'), false, (select id from dependency_group_type where name='base'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='gradient_boosting_classifier'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('ccp_alpha', 'Cost-Complexity Pruning alpha', 'Complexity parameter used for Minimal Cost-Complexity Pruning. The subtree with the largest cost complexity that is smaller than ccp_alpha will be chosen. By default, no pruning is performed.', true, false, 1, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('criterion', 'Criterion', 'The function to measure the quality of a split.', false, false, 2, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Step size shrinkage used in update to prevents overfitting. After each boosting step, we can directly get the weights of new features, and eta shrinks the feature weights to make the boosting process more conservative.', false, false, 3, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('loss', 'Loss', 'Loss function to be optimized.', false, false, 4, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth of the tree. If None, then nodes are expanded until all leaves are pure or until all leaves contain less than min_samples_split samples.', true, false, 5, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_features', 'Maximum features', 'The number of features to draw from X to train each base estimator.', false, false, 6, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_leaf_nodes', 'Maximum number of nodes', 'Grow a tree with max_leaf_nodes in best-first fashion. Best nodes are defined as relative reduction in impurity. If None then unlimited number of leaf nodes.', true, false, 7, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_impurity_decrease', 'Minimum impurity decrease', 'A node will be split if this split induces a decrease of the impurity greater than or equal to this value.', true, false, 8, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_leaf', 'Minimum samples per leaf', 'The minimum number of samples required to be at a leaf node expressed as a fraction of all training samples.', false, false, 9, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_samples_split', 'Minimum sample split', 'The minimum number of samples required to split an internal node expressed as a fraction of all training samples.', true, false, 10, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_weight_fraction_leaf', 'Minimum weighted sum per leaf', 'The minimum weighted fraction of the sum total of weights (of all the input samples) required to be at a leaf node. Samples have equal weight when sample_weight is not provided.', false, false, 11, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_estimators', 'Number of estimators', 'The number of base estimators in the ensemble.', false, false, 12, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_iter_no_change', 'Maximum number of iterations with no change', 'Maximum number of epochs to not meet tol improvement. Only effective when solver=''sgd'' or ''adam''.', false, false, 13, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample', 'Subsample', 'Subsample ratio of the training instances. Setting it to 0.5 means that XGBoost would randomly sample half of the training data prior to growing trees. and this will prevent overfitting. Subsampling will occur once in every boosting iteration.', false, false, 14, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', false, false, 15, (select id from Model where name='gradient_boosting_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('validation_fraction', 'Validation fraction', 'The proportion of training data to set aside as validation set for early stopping.', false, false, 16, (select id from Model where name='gradient_boosting_classifier'));
