INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('nearest_centroid_classifier', (select id from ml_task_type where name='classification'),'Nearest Centroid Classifier is a specialized type of neighbor classifier model which represents each class by the centroid of its members.', 'Nearest Centroid Classifier', (select id from model_structure_type where name='base'), '{It is easy to understand and implement,It works well when classes are compact and far from each other}', '{It has poor performance for complex classes,It can not handle outliers noisy data and missing data well}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='base'));
