INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('linearsvc_classifier', (select id from ml_task_type where name='classification'),'Linear Support Vector Machine Classifier is similar to Support Vector Machine Classifier with the linear kernel but has more flexibility in the choice of penalties and loss functions.', 'Linear Support Vector Machine Classifier', (select id from model_structure_type where name='base'), '{It performs well in higher dimension spaces,It is robust to outliers}', '{It is computationally expensive,It is tricky in selecting the appropriate kernel function}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='base'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('C', 'C', 'Inverse of regularization strength; must be a positive float. Like in support vector machines, smaller values specify stronger regularization.', true, false, 1, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Weights associated with classes in the form {class_label: weight}. If not given, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)).', false, false, 2, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('dual', 'Dual', 'Select the algorithm to either solve the dual or primal optimization problem. Prefer dual=False when n_samples > n_features.', false, false, 3, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 4, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('intercept_scaling', 'Intercept scaling', 'Useful only when the solver ''liblinear'' is used and self.fit_intercept is set to True. In this case, x becomes [x, self.intercept_scaling], i.e. a “synthetic” feature with constant value equal to intercept_scaling is appended to the instance vector. The intercept becomes intercept_scaling * synthetic_feature_weight.', false, false, 5, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('loss', 'Loss', 'Specifies the loss function. inge is the standard SVM loss while squared_hingeis the square of the hinge loss.', false, false, 6, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', true, false, 7, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('multi_class', 'Multi-class', 'Determines the multi-class strategy if y contains more than two classes.', false, false, 8, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('penalty', 'Penalty', 'Specifies the norm used in the penalization. The l2 penalty is the standard used in SVC. The l1 leads to coef_vectors that are sparse.', false, false, 9, (select id from Model where name='linearsvc_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', true, false, 10, (select id from Model where name='linearsvc_classifier'));
