INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('logistic_regression_classifier', (select id from ml_task_type where name='classification'),'The logistic regression classifier is a linear model for classification, implemented in the scikit-learn library. It estimates the probability of an instance belonging to a specific class by fitting a logistic function to the input data. The model supports various regularization techniques, solvers, and multi-class strategies.', 'Logistic Regression Classifier', (select id from model_structure_type where name='base'), '{Ease of implementation and effectiveness,Computational efficiency,Low likelihood of overfitting}', '{Struggles with non-linear data,Impaired performance due to irrelevant or highly correlated features}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from dependency_group_type where name='base'));
