INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('C', 'C', 'Inverse of regularization strength (positive float); smaller values indicate stronger regularization, which helps prevent overfitting.', false, false, 1, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Enables control over the weight of different the classes in your training dataset, which can be beneficial when working with imbalanced data. If set to None, all classes are given equal weight. If set to balanced, the class weights are adjusted proportionally to their frequencies in the input data.', false, false, 2, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('dual', 'Dual', 'Boolean indicating whether to use the dual or primal formulation of the optimization problem.', false, false, 3, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Boolean indicating whether to calculate the model''s intercept; if False, data is expected to be centered and no intercept is used.', false, false, 4, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('intercept_scaling', 'Intercept scaling', 'Applicable when using ''liblinear'' solver and ''fit_intercept'' is True; adds a synthetic feature with a constant value equal to intercept_scaling to the instance vector.', false, false, 5, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l1_ratio', 'L1 ratio', 'Elastic-Net mixing parameter (0 <= l1_ratio <= 1); controls the balance between L1 and L2 regularization.', true, false, 6, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', 'Maximum number of iterations for the solver to converge.', true, false, 7, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('multi_class', 'Multi_class', 'Strategy for handling multi-class problems; ''ovr'' fits a binary problem for each label, while ''multinomial'' minimizes the multinomial loss across the entire probability distribution.', false, false, 8, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('penalty', 'Penalty', 'Norm of the regularization penalty (e.g., ''l1'', ''l2'', ''elasticnet'').', true, false, 9, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('solver', 'Solver', 'Algorithm used to solve the optimization problem (e.g., ''newton-cg'', ''lbfgs'', ''liblinear'', ''sag'', ''saga'').', true, false, 10, (select id from Model where name='logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Tolerance for stopping criterion; solver converges when the residual''s maximum norm is below this value.', true, false, 11, (select id from Model where name='logistic_regression_classifier'));
