INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('sgd_classifier', (select id from ml_task_type where name='classification'),'Stochastic Gradient Descent Classifier is a linear classifier with stochastic gradient descent (SGD) training. The gradient of the loss is estimated each sample at a time and the model is updated along the way with a decreasing strength schedule.', 'Stochastic Gradient Descent Classifier', (select id from model_structure_type where name='base'), '{It is computationally efficient,It has fast convergence for larger datasets}', '{It is not stable}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from dependency_group_type where name='base'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('alpha', 'Alpha', 'Constant that multiplies the penalty terms.', true, false, 1, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('average', 'Average', 'When set to True, computes the averaged SGD weights accross all updates and stores the result in the coef_ attribute.', false, false, 2, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Weights associated with classes in the form {class_label: weight}. If not given, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)).', false, false, 3, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('early_stopping', 'Early stopping', 'Whether to use early stopping to terminate training when validation score is not improving.', false, false, 4, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('epsilon', 'Epsilon', 'Value for numerical stability in adam. Only used when solver=''adam''.', false, false, 5, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('eta0', 'Eta0', 'The initial learning rate for the ''constant'', ''invscaling'' or ''adaptive'' schedules.', false, false, 6, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Whether to calculate the intercept for this model. If set to False, no intercept will be used in calculations (i.e. data is expected to be centered).', false, false, 7, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l1_ratio', 'L1 ratio', 'The Elastic-Net mixing parameter, with 0 <= l1_ratio <= 1.', true, false, 8, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Step size shrinkage used in update to prevents overfitting. After each boosting step, we can directly get the weights of new features, and eta shrinks the feature weights to make the boosting process more conservative.', false, false, 9, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('loss', 'Loss', 'Loss function to be optimized.', true, false, 10, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', false, false, 11, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_iter_no_change', 'Maximum number of iterations with no change', 'Maximum number of epochs to not meet tol improvement. Only effective when solver=''sgd'' or ''adam''.', false, false, 12, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('penalty', 'Penalty', 'The penalty (aka regularization term) to be used.', true, false, 13, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('power_t', 'Power t', 'The exponent for inverse scaling learning rate.', false, false, 14, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('shuffle', 'Shuffle', 'Whether to shuffle samples in each iteration.', false, false, 15, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', true, false, 16, (select id from Model where name='sgd_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('validation_fraction', 'Validation fraction', 'The proportion of training data to set aside as validation set for early stopping.', false, false, 17, (select id from Model where name='sgd_classifier'));
