INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('passive_aggressive_classifier', (select id from ml_task_type where name='classification'),'Passive Aggressive Classifier is a family of algorithms for large-scale learning. It is similar to the Perceptron in that they do not require a learning rate but contrary to the Perceptron in that they include a regularization parameter.', 'Passive Aggressive Classifier', (select id from model_structure_type where name='base'), '{It is suitable for large-scale learning}', '{It has the problem of learning many simple functions}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from dependency_group_type where name='base'));
