INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('nlp_sequence_classifier', (select id from ml_task_type where name='classification'),'The NLP Sequence Classifier is an interface to Hugging Face''s Transformers, designed to simplify and optimize text classification tasks. Leveraging pre-trained models from the Transformers library, this classifier aims to offer state-of-the-art performance in natural language understanding.', 'NLP Sequence Classifier', (select id from model_structure_type where name='base'), '{Leverages Pre-trained Models: By utilizing the pre-trained models from Hugging Face''s extensive library, the NLP Sequence Classifier offers a quick and powerful way to benefit from the latest advancements in NLP without the need for extensive data or computational resources.,Ease of Use: The wrapper simplifies the application of complex transformer-based models into text classification tasks, making it easier for developers to integrate advanced NLP functionalities into their applications.,Highly Versatile: Given the underlying architecture, the NLP Sequence Classifier can be adapted to various text classification problems ranging from sentiment analysis to topic classification, providing high-quality results across a wide array of use-cases.}', '{Computational Overhead: Utilizing transformer models generally comes with high computational costs in terms of memory and processing power, especially for large datasets or complex architectures.,Lack of Interpretability: Transformer models, being highly complex, do not offer straightforward ways to interpret their decisions, making them less ideal for applications where model interpretability is crucial.,Dependence on Pre-trained Models: While leveraging pre-trained models is an advantage in terms of performance and speed, it may limit customization and adaptation to highly specific or nuanced tasks that require training from scratch.}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='huggingface'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('model', 'Transformer Model Name', 'Name of the transformer model.', false, false, 1, (select id from Model where name='nlp_sequence_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('batch_size', 'Batch Size', 'The batch size parameter determines the number of training examples used to calculate the gradient update in each iteration of the optimization process, influencing both the training speed and the model''s generalization performance.', false, false, 2, (select id from Model where name='nlp_sequence_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('epochs', 'Epochs', 'Number of epochs to train the model.', false, false, 3, (select id from Model where name='nlp_sequence_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning Rate', 'Learning rate for the optimizer.', false, false, 4, (select id from Model where name='nlp_sequence_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('lr_scheduler_type', 'Learning Rate Scheduler', 'Specifies the type of learning rate scheduler used during training, controlling how the learning rate is adjusted over time to improve model convergence and performance.', false, false, 5, (select id from Model where name='nlp_sequence_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_length', 'Max Length', 'Maximum length of the input sequence.', false, false, 6, (select id from Model where name='nlp_sequence_classifier'));
