INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('intelex_logistic_regression_classifier', (select id from ml_task_type where name='classification'),'The logistic regression classifier is a linear model for classification, implemented using the scikit-learn library. It estimates the probability of an instance belonging to a specific class by fitting a logistic function to the input data. The model supports various regularization techniques, solvers, and multi-class strategies.', 'Intelex Logistic Regression Classifier', (select id from model_structure_type where name='base'), '{Logistic regression provides probabilities of each class label, which helps the user judge the confidence of predictions,It is simple to understand and explain, which supports interpretability.,It handles binary and multiclass classification problems, enhancing its applicability.}', '{Logistic regression assumes linearity of independent variables and log odds, limiting its use in complex nonlinear relationships.,It might be prone to overfitting, particularly in scenarios with many input features.,It''s not ideal for large number of features or variables, due to the risk of multicollinearity.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from dependency_group_type where name='intelex'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('C', 'C', 'Inverse of regularization strength (positive float); smaller values indicate stronger regularization, which helps prevent overfitting.', false, false, 1, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Enables control over the weight of different the classes in your training dataset, which can be beneficial when working with imbalanced data. If set to None, all classes are given equal weight. If set to balanced, the class weights are adjusted proportionally to their frequencies in the input data.', false, false, 2, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('dual', 'Dual', 'Boolean indicating whether to use the dual or primal formulation of the optimization problem.', false, false, 3, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fit_intercept', 'Calculate Intercept', 'Boolean indicating whether to calculate the model''s intercept; if False, data is expected to be centered and no intercept is used.', false, false, 4, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('intercept_scaling', 'Intercept scaling', 'Applicable when using ''liblinear'' solver and ''fit_intercept'' is True; adds a synthetic feature with a constant value equal to intercept_scaling to the instance vector.', false, false, 5, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l1_ratio', 'L1 ratio', 'Elastic-Net mixing parameter (0 <= l1_ratio <= 1); controls the balance between L1 and L2 regularization.', true, false, 6, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', 'Maximum number of iterations for the solver to converge.', true, false, 7, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('multi_class', 'Multi_class', 'Strategy for handling multi-class problems; ''ovr'' fits a binary problem for each label, while ''multinomial'' minimizes the multinomial loss across the entire probability distribution.', false, false, 8, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('penalty', 'Penalty', 'Norm of the regularization penalty (e.g., ''l1'', ''l2'', ''elasticnet'').', true, false, 9, (select id from Model where name='intelex_logistic_regression_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('solver', 'Solver', 'Algorithm used to solve the optimization problem (e.g., ''newton-cg'', ''lbfgs'', ''liblinear'', ''sag'', ''saga'').', true, false, 10, (select id from Model where name='intelex_logistic_regression_classifier'));
