INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('intelex_svm_classifier', (select id from ml_task_type where name='classification'),'Support Vector Machine Classifier builds a hyperplane with support vectors to separate marked example points.', 'Intelex Support Vector Machine Classifier', (select id from model_structure_type where name='base'), '{Support Vector Machines (SVMs) perform well in high-dimensional spaces, making them suitable for datasets with many features.,They use a subset of training points in the decision function (support vectors), making them memory efficient.,They''re versatile, as different Kernel functions can be specified for the decision function.}', '{They are not efficient with large datasets because the training time can be cubic in the size of the dataset.,SVMs don''t provide probability estimates directly, which can be a disadvantage in certain use cases.,If the number of features greatly exceeds the number of samples, the SVM can perform poorly and overfitting can occur.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='intelex'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('C', 'C', 'Inverse of regularization strength; must be a positive float. Like in support vector machines, smaller values specify stronger regularization.', true, false, 1, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('break_ties', 'Break ties', 'f true, decision_function_shape=''ovr'', and number of classes > 2, predict will break ties according to the confidence values of decision_function; otherwise the first class among the tied classes is returned.', false, false, 2, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Sets the weights for all classes. If None, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)).', false, false, 3, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('coef0', 'Coefficient 0', 'Independent term in kernel function. It is only significant in ''poly'' and ''sigmoid''.', false, false, 4, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('decision_function_shape', 'Decision function shape', 'Whether to return a one-vs-rest (ovr) decision function of shape (n_samples, n_classes) as all other classifiers, or the original one-vs-one (ovo) decision function of libsvm.', false, false, 5, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('degree', 'Degree', 'Degree of the polynomial kernel function (''poly''). Ignored by all other kernels.', false, false, 6, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('gamma', 'Gamma', 'Kernel coefficient for ''rbf'', ''poly'' and ''sigmoid''.', false, false, 7, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('kernel', 'Kernel', 'Specifies the kernel type to be used in the algorithm. It must be one of, ''poly'', ''rbf'', ''sigmoid'', ''precomputed'' or a callable. If none is given, ''rbf'' will be used. If a callable is given it is used to precompute the kernel matrix.', true, false, 8, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_iter', 'Maximum number of iterations', '    Maximum number of iterations taken for the solvers to converge.', true, false, 9, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('shrinking', 'Shrinking', 'Whether to use the shrinking heuristic.', false, false, 10, (select id from Model where name='intelex_svm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tol', 'Tolerance', 'Maximum norm of the residual.', true, false, 11, (select id from Model where name='intelex_svm_classifier'));
