INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('feature_reduction_stacking_classifier', (select id from ml_task_type where name='classification'),'A meta-classifier is fitted on the predictions of a number of base models, which may be reduced to a lower dimensional space. It is combined with the initial training data, which is reduced to a lower dimensional space.', 'Feature Reduction Stacking Classifier', (select id from model_structure_type where name='dynamic'), '{}', '{}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='stacking'));
INSERT INTO rel_model__model_type(model_id, model_type_id) VALUES ((select id from model where name='feature_reduction_stacking_classifier'), (select id from model_type where name='Ensemble Model'));
INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('stacking_classifier', (select id from ml_task_type where name='classification'),'A meta-classifier is fitted on the predictions of a number of base models, which may be combined with the initial training data.', 'Stacking Classifier', (select id from model_structure_type where name='dynamic'), '{}', '{}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='stacking'));
INSERT INTO rel_model__model_type(model_id, model_type_id) VALUES ((select id from model where name='stacking_classifier'), (select id from model_type where name='Ensemble Model'));
INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('base_reduction_stacking_classifier', (select id from ml_task_type where name='classification'),'A meta-classifier is fitted on the predictions of a number of base models and the base predictions space is reduced to a lower dimensional space. It may be combined with the initial training data.', 'Base Reduction Stacking Classifier', (select id from model_structure_type where name='dynamic'), '{}', '{}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='stacking'));
INSERT INTO rel_model__model_type(model_id, model_type_id) VALUES ((select id from model where name='base_reduction_stacking_classifier'), (select id from model_type where name='Ensemble Model'));
INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('lightgbm_classifier', (select id from ml_task_type where name='classification'),'LightGBM Classifier is a tree-based ensemble model. It buckets continuous feature values into discrete bins and uses a gradient-based one-side sampling to split values. In comparison with XGBoost and CatBoost, LightGBM performs poorly on categorical datasets but has a similar performance to XGBoost on numerical datasets with fewer training time.', 'LightGBM Classifier', (select id from model_structure_type where name='base'), '{It is computational efficient,It performs well on large sized datasets}', '{It has the problem of overfitting especially on small data}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='tree'), false, (select id from dependency_group_type where name='lightgbm'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='lightgbm_classifier'),(select id from model_group_type where name='fast'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='lightgbm_classifier'),(select id from model_group_type where name='explainable'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='lightgbm_classifier'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('boosting_type', 'Boosting type', 'The type of boosting to use.', false, false, 1, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('class_weight', 'Class weight', 'Weights associated with classes in the form {class_label: weight}. If not given, all classes are supposed to have weight one. The “balanced” mode uses the values of y to automatically adjust weights inversely proportional to class frequencies in the input data as n_samples / (n_classes * np.bincount(y)).', false, false, 2, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('colsample_bytree', 'Column subsample ratio by tree', 'The subsample ratio of columns when constructing each tree. Subsampling occurs once for every tree constructed.', false, false, 3, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Step size shrinkage used in update to prevents overfitting. After each boosting step, we can directly get the weights of new features, and eta shrinks the feature weights to make the boosting process more conservative.', false, false, 4, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'The maximum depth of the tree. If None, then nodes are expanded until all leaves are pure or until all leaves contain less than min_samples_split samples.', true, false, 5, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_child_samples', 'Minimum childs per sample', 'Minimal number of data in one leaf. Can be used to deal with over-fitting.', false, false, 6, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_child_weight', 'Minimum child weight', 'Minimum sum of instance weight (hessian) needed in a child.', false, false, 7, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_split_gain', 'Minimal gain to split', 'The minimal gain to perform split.', false, false, 8, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_estimators', 'Number of estimators', 'The number of base estimators in the ensemble.', true, false, 9, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('num_leaves', 'Number of leaves', 'The maximum number of leaves in one tree.', true, false, 10, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('reg_alpha', 'Regularization alpha', 'L1 regularization term on weights. Increasing this value will make model more conservative.', false, false, 11, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('reg_lambda', 'Regularization lambda', 'L2 regularization term on weights. Increasing this value will make model more conservative.', false, false, 12, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample', 'Subsample', 'Subsample ratio of the training instances. Setting it to 0.5 means that LightGBM would randomly sample half of the training data prior to growing trees. and this will prevent overfitting. Subsampling will occur once in every boosting iteration.', false, false, 13, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample_for_bin', 'Subsamples to construct bin', 'Number of data that sampled to construct feature discrete bins.', false, false, 14, (select id from Model where name='lightgbm_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample_freq', 'Subsample frequency', 'Frequency for bagging.', false, false, 15, (select id from Model where name='lightgbm_classifier'));
