INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('fista_classifier', (select id from ml_task_type where name='classification'),'An estimator that employs the Fast Iterative Shrinkage-Thresholding Algorithm (FISTA) for training linear classifiers. Designed for fast convergence, FISTA is particularly well-suited for large-scale and high-dimensional problems. It encourages sparse solutions and is efficient in terms of memory usage. The algorithm is ideal for convex optimization problems and offers flexibility in regularization techniques.', 'Fast Iterative Shrinkage/Thresholding Classifier', (select id from model_structure_type where name='base'), '{Fast convergence, especially suitable for large datasets.,Encourages sparse solutions, advantageous in high-dimensional settings.,Resource-efficient, doesn''t require storing large intermediate matrices.}', '{Sensitive to the choice of hyperparameters, requiring careful tuning.,May suffer from numerical instabilities.}', true, (select id from model_ensemble_type where name='none'),(select id from model_family_type where name='linear'), false, (select id from dependency_group_type where name='base'));
