INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('eta', 'Eta', 'Decrease factor for line-search procedure.', true, false, 2, (select id from Model where name='adagrad_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('gamma', 'Gamma', 'Gamma coefficient in the loss ''smooth_hinge''.', false, false, 3, (select id from Model where name='adagrad_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l1_ratio', 'L1 ratio', 'The L1 ratio parameter represents the trade-off between the L1 and L2 regularization terms in the objective function. A value of 0 indicates L2 regularization only, while a value of 1 indicates L1 regularization only. Values between 0 and 1 apply a mix of both L1 and L2 regularization, which can be advantageous for capturing different types of feature importance while preventing overfitting.', true, false, 4, (select id from Model where name='adagrad_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('loss', 'Loss', 'The loss function to be used.', true, false, 5, (select id from Model where name='adagrad_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_iter', 'Number of iterations', 'This parameter specifies the maximum number of iterations the optimization algorithm will run to converge to a solution. Each iteration involves a complete pass over the training data. Setting this to a low value may speed up training but could result in suboptimal performance. Conversely, a higher value may allow the model to converge to a better solution but at the cost of increased computational time.', false, false, 6, (select id from Model where name='adagrad_classifier'));
