INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('catboost_classifier', (select id from ml_task_type where name='classification'),'The CatBoost Classifier is a gradient-boosting model specialized in handling categorical features through permutation-driven techniques. It uses ordered boosting to reduce overfitting and symmetric trees for faster execution. It is often compared favorably to XGBoost and LightGBM, particularly when dealing with categorical data.', 'CatBoost Classifier', (select id from model_structure_type where name='base'), '{Handles categorical features well,Reduced overfitting through ordered boosting,Fast execution with symmetric trees,Competitive performance compared to XGBoost and LightGBM,Robust default settings}', '{Higher memory consumption,Less interpretable than simpler models,May require parameter tuning for optimal performance,Can be slower to train on very large datasets}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='other'), false, (select id from dependency_group_type where name='catboost'));
