INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('auto_class_weights', 'Automatic class weights', 'Enables automatic class weights calculation. It may be useful for imbalanced datasets.', false, false, 2, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('bagging_temperature', 'Bagging temperature', 'Defines the settings of the Bayesian bootstrap. It is used by default in classification and regression modes.', false, false, 3, (select id from Model where name='catboost_classifier'));
