INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('final_ctr_computation_mode', 'Final CTR computation mode', 'Final CTR computation mode.', false, false, 6, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fold_len_multiplier', 'Fold length multiplier', 'Coefficient for changing the length of folds.', false, false, 7, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('fold_permutation_block', 'Fold permutation block', 'Objects in the dataset are grouped in blocks before the random permutations. This parameter defines the size of the blocks. The smaller is the value, the slower is the training. Large values may result in quality degradation.', false, false, 8, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('has_time', 'Has time', 'Use the order of objects in the input data (do not perform random permutations during the Transforming categorical features to numerical features and Choosing the tree structure stages).', false, false, 9, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('iterations', 'Iterations', 'The number of iterations.', true, false, 10, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('l2_leaf_reg', 'L2 regularization coefficient', 'Coefficient at the L2 regularization term of the cost function.', false, false, 11, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Step size shrinkage used in update to prevents overfitting. After each boosting step, we can directly get the weights of new features, and eta shrinks the feature weights to make the boosting process more conservative.', false, false, 12, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_ctr_complexity', 'Maximum complexity', 'The maximum number of features that can be combined.', false, false, 13, (select id from Model where name='catboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('model_size_reg', 'Model size regularization coefficient', 'This parameter influences the model size if training data has categorical features.', false, false, 14, (select id from Model where name='catboost_classifier'));
