INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('random_strength', 'Random strength', 'The amount of randomness to use for scoring splits when the tree structure is selected. Use this parameter to avoid overfitting the model.', false, false, 18, (select id from Model where name='catboost_classifier'));
