INSERT INTO model(name, ml_task_id, description, display_name, structure_id, advantages, disadvantages, enabled, ensemble_type_id, family_type_id, decision_tree, dependency_group_id) VALUES ('xgboost_classifier', (select id from ml_task_type where name='classification'),'The XGBoost Classifier is a powerful and efficient gradient boosting model from the XGBoost library. It combines multiple weak learners, typically decision trees, to create a strong ensemble model. In each iteration, a new weak learner is added to the ensemble, focusing on correcting the errors made by the previous learners. Predictions from the ensemble model are given by a weighted sum of the predictions of the individual weak learners. XGBoost Classifier is known for its high performance, scalability, and ability to handle imbalanced datasets, making it a popular choice for a wide range of machine learning tasks.', 'XGBoost Classifier', (select id from model_structure_type where name='base'), '{It requires less feature engineering,Feature importance can be found out,It is robust to outliers,It performs well on large sized datasets,It is computational fast}', '{It has the problem of overfitting,It is harder to tune as there are too many hyperparameters}', true, (select id from model_ensemble_type where name='other'),(select id from model_family_type where name='tree'), false, (select id from dependency_group_type where name='xgboost'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='xgboost_classifier'),(select id from model_group_type where name='fast'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='xgboost_classifier'),(select id from model_group_type where name='explainable'));
INSERT INTO rel_model__groups(model_id, group_id) VALUES ((select id from Model where name='xgboost_classifier'),(select id from model_group_type where name='advanced'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('booster', 'Booster', 'Specifies the core boosting algorithm, determining the type of base learners in the ensemble model.', false, false, 1, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('colsample_bylevel', 'Column subsample ratio by level', 'Fraction of features randomly sampled for each level of the decision tree during construction.', false, false, 2, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('colsample_bynode', 'Column subsample ratio by node', 'Fraction of features randomly sampled for each new node in the decision tree during construction.', false, false, 3, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('colsample_bytree', 'Column subsample ratio by tree', 'Fraction of features randomly sampled for each tree during model construction.', false, false, 4, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('gamma', 'Gamma', 'Minimum reduction in loss function required to create a new tree split, controlling model complexity and preventing overfitting.', true, false, 5, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('learning_rate', 'Learning rate', 'Step size shrinkage used in updates to prevent overfitting, making the boosting process more conservative.', false, false, 6, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_delta_step', 'Maximum delta step', 'Maximum allowed change for each leaf output in the tree, mitigating imbalanced data influence by limiting weight updates.', false, false, 7, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('max_depth', 'Maximum depth', 'Maximum depth of the tree. Nodes are expanded until all leaves are pure or contain less than min_samples_split samples.', true, false, 8, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('min_child_weight', 'Minimum child weight', 'Minimum number of training examples required in each tree node to allow further splitting.', false, false, 9, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('n_estimators', 'Number of estimators', 'Number of trees built during the training process.', true, false, 10, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('num_parallel_tree', 'Number of parallel trees', 'Number of parallel trees constructed during each iteration, supporting boosted random forests.', false, false, 11, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('reg_alpha', 'Regularization alpha', 'Strength of L1 regularization term, penalizing absolute values of leaf node weights, promoting sparsity and reducing overfitting.', true, false, 12, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('reg_lambda', 'Regularization lambda', 'Strength of L2 regularization term, penalizing squared values of leaf node weights, encouraging smaller weights and reducing overfitting.', true, false, 13, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('scale_pos_weight', 'Scale weight of positive class', 'Balance of positive and negative weights in binary classification, useful for imbalanced classes. Consider: sum(negative instances) / sum(positive instances).', false, false, 14, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('subsample', 'Subsample', 'Fraction of training examples randomly sampled without replacement for each tree, reducing overfitting and improving generalization.', true, false, 15, (select id from Model where name='xgboost_classifier'));
INSERT INTO parameter(name, label, description, enabled, fixed_value, ordering, model_id) VALUES ('tree_method', 'Tree method', 'Algorithm used to construct decision trees during the training process.', false, false, 16, (select id from Model where name='xgboost_classifier'));
